using ObjectiveC;using System;using SwiftSharp.Attributes;namespace Foundation{	//https://developer.apple.com/library/prerelease/ios/documentation/Cocoa/Reference/NSMachPortDelegate_Protocol/index.html#//apple_ref/occ/intf/NSMachPortDelegate	/// <summary>	/// The NSMachPortDelegate protocol defines the optional methods implemented by delegates of NSMachPort objects.	/// </summary>	[iOSVersion(4)]	public interface NSMachPortDelegate	{		/// <summary>		/// Process an incoming Mach message.		/// </summary>		/// <param name="machMessage">A pointer to a Mach message, cast as a pointer to void.</param>		[iOSVersion(2)]		[Export("handleMachMessage")]		[Optional]		void HandleMachMessage(CMutableVoidPointer machMessage);	}}